import React from 'react'
import "../css_styles/cards.css";
const Cards = ({tech}) => {
    return (
        <div className="cards">
            <img src={tech.urlToImage} alt=""/>
            <div>
                <h4 className="cards__title">{tech.title}</h4>
                <h4 className="cards__description">{tech.description}</h4>
                <h4 className='cards__content'>{tech.content}</h4>
            </div>
        </div>
    )
}

export default Cards
